import React from "react";
import './Navigation.css';


const Navigation = ({route}) => {
    if(route=== 'signin')
    {return (
        <nav >
            <p className="f3 link dim black underline pointer pa3">Sign Out</p>
        </nav>
    );}
    if(route === 'register'){
        return (
            <nav >
                <p className="f3 link dim black underline pointer pa3">Sign In </p>
            </nav>
        );
    }
    if(route !== 'register' || route !== 'signin'){
        return (
            <nav >
                <p className="f3 link dim black underline pointer pa3">Sign Out</p>
            </nav>
        );
    }


}
export default Navigation;
